import React from "react";
import { motion } from "framer-motion";

export default function Projects() {
  return (
    <section className="max-w-4xl mx-auto mb-10 p-6 bg-white rounded-xl shadow-md">
      <h2 className="text-3xl font-semibold border-b pb-2 mb-4 text-purple-600">Projects</h2>
      <div className="space-y-6 text-gray-700">
        <div>
          <h3 className="text-xl font-bold text-blue-600">Student Attendance Management System</h3>
          <p>Built using React and connected to a backend API. Features include adding/viewing student data through a user-friendly UI.</p>
        </div>
        <div>
          <h3 className="text-xl font-bold text-blue-600">Kidney Stone Detection System</h3>
          <p>Developed a deep learning model to detect kidney stones, aiming to assist in early diagnosis and healthcare support.</p>
        </div>
        <div>
          <h3 className="text-xl font-bold text-blue-600">Road Pavement Condition Analysis System</h3>
          <p>Created a system using deep learning for automating road condition analysis, improving infrastructure evaluation accuracy.</p>
        </div>
      </div>
    </section>
  );
}
